Caterina Valente (b. January 14, 1931, Paris, France) was born into an Italian circus family. Her mother was a clown and her father was an accordion player; as a child she worked in the circus as well. She performed in Europe as a singer for several years, but her career as an internationally known vocalist began in 1953 when she joined Kurt Edelhagen's band in Germany. She was soon signed to Polydor and made her recording debut for them the same year. Her first big hits came soon after that. Two songs written for her by Cuban composer Ernesto Lecuona charted in Europe and eventually England and the U.S. &quot;Malaguena&quot; was her first big hit, followed by &quot;Analucia&quot; which when re-released in an English version as &quot;The Breeze and I&quot; became a top ten hit in both the U.K. 

